<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0 maximum-scale=1.0, minimum-scale=1.0, user-scalable=no">
    <meta http-equiv="X-UA-Compatible" content="ie=edge">
    <link rel="stylesheet" href="style.css">
    <link rel="shortcut icon" type="image/png" href="favicon.png">
    <meta name="theme-color" content="#000000"/>
</head>
<body>
    <canvas id="canvas" width="800" height="600"></canvas>
    <p id="picture-mode-element"></p>
    <script>
    let startKeys = Object.keys(this);
    startKeys = startKeys.reduce((pv,cv)=>{pv[cv]=true;return pv},{});
    </script>

    <!-- Begin load engine -->
    <script src="elven-engine/canvas-manager.js"></script>
    <script src="elven-engine/constants.js"></script>
    <script src="elven-engine/controller-helper.js"></script>
    <script src="elven-engine/audio-manager.js"></script>
    <script src="elven-engine/file-managers.js"></script>
    <script src="elven-engine/files.js"></script>
    <script src="elven-engine/renderers/components/fader.js"></script>
    <script src="elven-engine/renderers/components/custom-text.js"></script>
    <!-- End load engine -->


    <!-- Begin expected runtime engine -->
    <script src="elven-one/files.js"></script>
    <script src="elven-one/constants.js"></script>
    <!-- End expected runtime engine -->


    <!-- Begin custom runtime renderers -->
    <script src="elven-one/renderers/overworld-test.js"></script>
    <script src="elven-one/renderers/components/player-animator.js"></script>
    <!-- End custom runtime renderers -->


    <!-- Begin custom runtime components -->

    <!-- End custom runtime components -->


    <!-- Begin expected runtime initializer -->
    <script src="elven-one/script.js"></script>
    <!-- End expected custom engine -->

    <script>
    (function(){
        const endKeys = Object.keys(this);
        console.log("New keys",endKeys.filter(endKey => {
            if(!startKeys[endKey]) {
                return true;
            } else {
                return false;
            }
        }));
    })();
    </script>
</body>
</html>
